pragma solidity ^0.8.0;
//import "./MarketSearch.sol";
struct Quote {
    uint256 quotemin;
    uint256 quoteavg;
    uint256 quotemax;
}

struct Remainer {
    bytes32 currency;
    uint256 qty;
}

struct Solution {
    uint256 orderid;
    bytes32 addr;
    uint256 qty; // can be 0 if it use remainer
    uint256 granularity;
    uint256 quote;
    uint256[] delivery;
}
struct SolutionSetDesc {
    bytes32[] path;
    uint256 qty;
    Quote quote;
    uint start;
    uint count;
    uint[] offset;
}
struct SolutionSet {
    uint256 qty;
    Quote quote;
    //uint256 useddescs;
    //uint256 usedsolutions;
    SolutionSetDesc[] descs;
    Solution[] solutions;
}

library MarketLib {
