    function update(Remainer[] memory remainer_,SolutionSetDesc memory in_,Solution[] memory solin_)
        public
        pure 
        returns (Remainer[] memory remainerout_)
    {
        remainerout_ = remainer_;

        uint len = in_.offset.length;
        if (in_.offset.length==0)
            return remainerout_;

        uint256 previoustotal=0;
        uint offsetend = solin_.length;
        for (uint i;i<len+1;i++)
        {
            uint offsetstart;
            if (i==len)
                offsetstart=0;
            else
                offsetstart = in_.offset[len-1-i];

            uint256 total;
            uint256 qty;
            for (uint j=offsetstart;j<offsetend;j++)
            {
                qty+=solin_[j].qty;
                total+=(solin_[j].qty*solin_[j].quote)/10**18;
            }
            if (i>0)
            {
                bytes32 addr = in_.path[in_.path.length-1-i];
                //remainerout_ = add(remainerout_,addr,qty-previoustotal);

                if (qty>previoustotal)
                    remainerout_ = add(remainerout_,addr,qty-previoustotal);
                else if (qty<previoustotal)
                    remainerout_ = remove(remainerout_,addr,previoustotal-qty);
            }
            previoustotal = total;
            offsetend= offsetstart;

        }
    }
    function get(Remainer[] memory remainer_, bytes32 currency_)
        public
        pure
        returns (uint256 qty_)
    {
        for (uint256 i; i < remainer_.length; i++)
            if (remainer_[i].currency == currency_) return remainer_[i].qty;
        return 0;
    }

    function add(
        Remainer[] memory remainer_,
        bytes32 currency_,
        uint256 qty_
    ) public pure returns (Remainer[] memory out_)  {
        out_ = remainer_;
        for (uint256 i; i < out_.length; i++)
            if (out_[i].currency == currency_) {
                out_[i].qty += qty_;
                return out_;
            }
        out_ = new Remainer[](remainer_.length + 1);
        for (uint256 i; i < remainer_.length; i++)
            out_[i] = remainer_[i];
        out_[remainer_.length].currency = currency_;
        out_[remainer_.length].qty = qty_;
        return out_;
    }

    function remove(
        Remainer[] memory remainer_,
        bytes32 currency_,
        uint256 qty_
    ) public pure returns (Remainer[] memory out_) {
        out_ = remainer_;
        for (uint256 i; i < out_.length; i++)
            if (out_[i].currency == currency_) {
                require(out_[i].qty>=qty_,"Remainer remove qty is superior to remainer qty");
                out_[i].qty -= qty_;
                if (out_[i].qty==0)
                {
                    if (out_.length>1)
                        out_[i] = out_[out_.length-1];
                    uint outcount = out_.length-1;
                    assembly {
                        mstore(out_, outcount)
                    }
                }
                return out_;
            }
        return out_;
    }

    function descAddOffset(SolutionSetDesc memory in_,Solution[] memory solin_, bytes32 currency_, Solution[] memory sol_)
        public
        pure
        returns (SolutionSetDesc memory out_,Solution[] memory solout_)
    {
        out_.qty = in_.qty;
        out_.quote = in_.quote;
        out_.path = new bytes32[](in_.path.length + 1);
        for (uint i; i < in_.path.length; i++) out_.path[i+1] = in_.path[i];
        out_.path[0] = currency_;

        out_.offset = new uint[](in_.offset.length+1);
        for (uint i; i < in_.offset.length; i++) out_.offset[i+1] = in_.offset[i]+sol_.length;
        out_.offset[0] = sol_.length;
        out_.count = sol_.length+solin_.length;
        solout_ = combine(sol_,solin_);
    }

    function descCreateFromTo(
        SolutionSetDesc memory desc_,
        bytes32 from_,
        bytes32 to_
    ) public pure returns (SolutionSetDesc memory out_) {
        out_ = desc_;
        out_.path = new bytes32[](2);
        out_.path[0] = from_;
        out_.path[1] = to_;
    }


    function getIdQty(Solution[] memory sol_, uint256 orderid_)
        public
        pure
        returns (uint256 qty_)
    {
        for (uint256 i; i < sol_.length; i++)
            if (sol_[i].orderid == orderid_) qty_ += sol_[i].qty;
    }
    function add(Solution[] memory sols_, Solution memory sol_)
        public
        pure
        returns (Solution[] memory out_)
    {
        for (uint256 i; i < sols_.length; i++) {
            if (sols_[i].orderid == sol_.orderid)
            {
                sols_[i].qty += sol_.qty;
                return sols_;
            }
        }
        Solution[] memory sol = new Solution[](1);
        sol[0] = sol_;
        return combine(sols_, sol);
    }
    function add(Solution[] memory sols_, Solution[] memory sol_)
        public
        pure
        returns (Solution[] memory out_)
    {
        out_ = sols_;
        for (uint256 i; i < sol_.length; i++) {
            out_ = add(out_,sol_[i]);
        }
    }

    function combine(Solution[] memory sol1_, Solution[] memory sol2_)
        public
        pure
        returns (Solution[] memory out_)
    {
        uint256 _sol1len = sol1_.length;
        uint256 _sol2len = sol2_.length;

        out_ = new Solution[](_sol1len + _sol2len);
        for (uint256 i; i < _sol1len; i++) {
            out_[i] = duplicate(sol1_[i]);
        }
        for (uint256 i; i < _sol2len; i++) {
            out_[_sol1len + i] = duplicate(sol2_[i]);
        }
    }

    function duplicate(Solution[] memory sol_)
        public
        pure
        returns (Solution[] memory out_)
    {
        return duplicate(sol_, 0, sol_.length);
    }

    function duplicate(
        Solution[] memory sol_,
        uint256 start_,
        uint256 count_
    ) public pure returns (Solution[] memory out_) {
        out_ = new Solution[](count_);
        for (uint256 i; i < count_; i++) {
            out_[i] = duplicate(sol_[start_ + i]);
        }
    }

    function duplicate(Solution memory sol_)
        public
        pure
        returns (Solution memory out_)
    {
        out_.orderid = sol_.orderid;
        out_.addr = sol_.addr;
        out_.qty = sol_.qty;
        out_.granularity = sol_.granularity;
        out_.quote = sol_.quote;
        out_.delivery = sol_.delivery;
    }

