    function order(Solution[] memory sol_)
        public
        pure
        returns (Solution[] memory out_)
    {
        out_ = new Solution[](sol_.length);
        uint256 _count = 0;
        for (uint256 i; i < sol_.length; i++) {
            // bubble sort based on quote
            Solution memory _ordertoinsert = sol_[i];
            uint j = 0;
            for (; j < _count; j++) {
                if (out_[j].quote > _ordertoinsert.quote) {
                    Solution memory _ordertosave = out_[j];
                    out_[j] = _ordertoinsert;
                    _ordertoinsert = _ordertosave;
                    j++;
                    break;
                }
            }

            for (; j < _count; j++) {
                Solution memory _ordertosave = out_[j];
                out_[j] = _ordertoinsert;
                _ordertoinsert = _ordertosave;
            }

            out_[_count++] = _ordertoinsert;
        }
    }

    function orderGranularity(Solution[] memory sol_)
        public
        pure
        returns (Solution[] memory out_)
    {
        out_ = new Solution[](sol_.length);
        uint256 _count = 0;
        for (uint256 i; i < sol_.length; i++) {
            // bubble sort based on quote
            Solution memory _ordertoinsert = sol_[i];
            uint32 j = 0;
            for (; j < _count; j++) {
                if (
                    (out_[j].granularity < _ordertoinsert.granularity) ||
                    ((out_[j].granularity == _ordertoinsert.granularity) &&
                        (out_[j].quote > _ordertoinsert.quote))
                ) {
                    Solution memory _ordertosave = out_[j];
                    out_[j] = _ordertoinsert;
                    _ordertoinsert = _ordertosave;
                    j++;
                    break;
                }
            }

            for (; j < _count; j++) {
                Solution memory _ordertosave = out_[j];
                out_[j] = _ordertoinsert;
                _ordertoinsert = _ordertosave;
            }

            out_[_count] = _ordertoinsert;
            _count++;
        }
    }

    function filterUsed(Solution[] memory sol_, Solution[] memory used_)
        public
        pure
        returns (Solution[] memory out_)
    {
        out_ = new Solution[](sol_.length);
        uint256 _count = 0;
        for (uint256 i; i < sol_.length; i++) {
            // bubble sort based on quote

            Solution memory _ordertoinsert = duplicate(sol_[i]);
            uint256 _qtyused = getIdQty(used_, _ordertoinsert.orderid);
            if (_qtyused >= _ordertoinsert.qty) continue;
            _ordertoinsert.qty -= _qtyused;
            if (_ordertoinsert.qty < _ordertoinsert.granularity) continue;

            out_[_count] = _ordertoinsert;
            _count++;
        }
        assembly {
            mstore(out_, _count)
        }
    }

    function getQtyQuote(Solution[] memory sol_)
        public
        pure
        returns (uint256 qty_, Quote memory quote_)
    {
        return getQtyQuote(sol_, sol_.length);
    }

    function getQtyQuote(Solution[] memory sol_, uint256 count_)
        public
        pure
        returns (uint256 qty_, Quote memory quote_)
    {
        for (uint256 j = 0; j < count_; j++) {
            if (quote_.quotemin == 0 || quote_.quotemin > sol_[j].quote)
                quote_.quotemin = sol_[j].quote;
            if (quote_.quotemax == 0 || quote_.quotemax < sol_[j].quote)
                quote_.quotemax = sol_[j].quote;
            quote_.quoteavg += (sol_[j].qty * sol_[j].quote) / 10**18;
            qty_ += sol_[j].qty;
        }
        quote_.quoteavg = qty_!=0 ? (quote_.quoteavg * 10**18) / qty_ : 0;
    }

    function getQty(Solution[] memory sol_, uint256 count_)
        public
        pure
        returns (uint256 qty_)
    {
        for (uint256 i; i < count_; i++) qty_ += sol_[i].qty;
    }

    function getQty(Solution[] memory sol_) public pure returns (uint256 qty_) {
        return getQty(sol_, sol_.length);
    }

    function getHasQty(Solution[] memory sol_, uint256 count_)
        public
        pure
        returns (bool)
    {
        for (uint256 i; i < count_; i++) if (sol_[i].qty > 0) return true;
        return false;
    }

    function getHasQty(Solution[] memory sol_) public pure returns (bool) {
        return getHasQty(sol_, sol_.length);
    }

    function getAvg(Solution[] memory sol_, uint256 count_)
        public
        pure
        returns (uint256 quote_)
    {
        uint256 _qty;
        for (uint256 i; i < count_; i++) {
            quote_ += (sol_[i].qty * sol_[i].quote) / 10**18;
            _qty += sol_[i].qty;
        }
        if (_qty > 0) quote_ = (quote_ * 10**18) / _qty;
    }

    function getAvg(Solution[] memory sol_)
        public
        pure
        returns (uint256 quote_)
    {
        return getAvg(sol_, sol_.length);
    }

    function getTotal(Solution[] memory sol_, uint256 count_)
        public
        pure
        returns (uint256 total_)
    {
        for (uint256 i; i < count_; i++)
            total_ += (sol_[i].qty * sol_[i].quote) / 10**18;
    }

    function getTotal(Solution[] memory sol_)
        public
        pure
        returns (uint256 total_)
    {
        return getTotal(sol_, sol_.length);
    }

    function add(SolutionSet memory set_, SolutionSet memory from_)
        public
        pure
        returns (SolutionSet memory out_)
    {
        out_.qty = set_.qty;
        out_.quote = set_.quote;
        out_.descs = new SolutionSetDesc[](set_.descs.length + from_.descs.length);
        for (uint256 i; i < set_.descs.length; i++) out_.descs[i] = set_.descs[i];
        for (uint256 i; i < from_.descs.length; i++) {
            out_.descs[set_.descs.length + i] = from_.descs[i];
            out_.descs[set_.descs.length + i].start += set_.solutions.length;
        }

        out_.solutions = new Solution[](
            set_.solutions.length + from_.solutions.length
        );
        for (uint256 i; i < set_.solutions.length; i++)
            out_.solutions[i] = set_.solutions[i];
        for (uint256 i; i < from_.solutions.length; i++)
            out_.solutions[set_.solutions.length + i] = from_.solutions[i];
        out_.quote.quotemin = set_.descs.length == 0 ? from_.quote.quotemin : out_.quote.quotemin>from_.quote.quotemin ? from_.quote.quotemin : out_.quote.quotemin;
        out_.quote.quotemax = out_.quote.quotemax<from_.quote.quotemax ? from_.quote.quotemax : out_.quote.quotemax;
        out_.quote.quoteavg = out_.qty+from_.qty!=0 ? (out_.quote.quoteavg*out_.qty + from_.quote.quoteavg*from_.qty) / (out_.qty+from_.qty) : 0;
        out_.qty += from_.qty;

    }
    function create(
        SolutionSetDesc memory desc_,
        Solution[] memory solutions_
    ) public pure returns (SolutionSet memory out_) {
        out_.solutions = duplicate(solutions_);

        out_.descs = new SolutionSetDesc[](1);
        out_.descs[0] = desc_;
        out_.descs[0].start = 0;
        out_.qty = desc_.qty;
        out_.quote = desc_.quote;

    }

    function add(
        SolutionSet memory set_,
        SolutionSetDesc memory desc_,
        Solution[] memory solutions_
    ) public pure returns (SolutionSet memory out_) {
        out_.qty = set_.qty;
        out_.quote = set_.quote;

        out_.solutions = new Solution[](set_.solutions.length + desc_.count);
        for (uint256 i; i < set_.solutions.length; i++)
            out_.solutions[i] = set_.solutions[i];
        for (uint256 i; i < desc_.count; i++)
            out_.solutions[set_.solutions.length + i] = solutions_[
                desc_.start + i
            ];

        out_.descs = new SolutionSetDesc[](set_.descs.length + 1);
        for (uint256 i; i < set_.descs.length; i++) out_.descs[i] = set_.descs[i];

        out_.descs[set_.descs.length] = desc_;
        out_.descs[set_.descs.length].start = set_.solutions.length;
        out_.quote.quotemin = set_.descs.length == 0 ? desc_.quote.quotemin : out_.quote.quotemin>desc_.quote.quotemin ? desc_.quote.quotemin : out_.quote.quotemin;
        out_.quote.quotemax = out_.quote.quotemax<desc_.quote.quotemax ? desc_.quote.quotemax : out_.quote.quotemax;
        out_.quote.quoteavg = out_.qty+desc_.qty!= 0 ? (out_.quote.quoteavg*out_.qty + desc_.quote.quoteavg*desc_.qty) / (out_.qty+desc_.qty) : 0;
        out_.qty += desc_.qty;

    }
}
